description:
The 67th Annual Primetime Emmy Awards honored the best in U.S. prime time television programming from June 1, 2014 until May 31, 2015, as chosen by the Academy of Television Arts &amp; Sciences. 

The ceremony was held on Sunday, September 20, 2015 at the Microsoft Theater in Downtown Los Angeles, California, and broadcast in the U.S. by Fox. Andy Samberg hosted the show for the first time. The nominations were announced on July 16, 2015.

The Creative Arts Emmy Awards ceremony were held on September 12 and was broadcast by FXX on September 19.

Game of Thrones set a new record by winning 12 awards.


